import React, { useState, useEffect } from "react";
import api from "../services/api";
import RotaCard from "../components/RotaCard";
import "./Home.css";

function Home() {
  const [rotas, setRotas] = useState([]);

  useEffect(() => {
    api.get("/rotas")
      .then((response) => setRotas(response.data))
      .catch((error) => console.error("Erro ao buscar rotas:", error));
  }, []);

  return (
    <div className="home">
      <h1>Bem-vindo ao RotaViagem</h1>
      <div className="rota-list">
        {rotas.map((rota) => (
          <RotaCard key={rota.id} rota={rota} />
        ))}
      </div>
    </div>
  );
}

export default Home;
